import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './login.css';

export default class login extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (
            <>
                <div className="container-fluid backlay">
                    <div className="row">
                        <div class="col-md-6 left">
                            <div className="brandName">

                            </div>
                            <div>

                            </div>
                        </div>
                    </div>
                </div>
            </>
        )
    }
}
